import { toBase64String } from '@angular/compiler/src/output/source_map';
import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-verbyte',
  templateUrl: './verbyte.component.html',
  styleUrls: ['./verbyte.component.css']
})
export class VerbyteComponent implements OnInit {
  
  arrayByte = [
    {0:
      "data:text/plain;base64,"
    },
    {1:
      "data:image/jpeg;base64,"
    },
    {2:
      "data:application/pdf;base64,"
    },
    {3:
      "data:application/vnd.openxmlformats-officedocument.wordprocessingml.document;base64,"
    },
    {4:
      "data:application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;base64,"
    }
  ];
    

  constructor() {
    
  }
  
  ngOnInit() {
  }
  
  baixarArquivo(bt: number) {
    var base64 = this.arrayByte[bt];
    const linkSource = base64[bt];
    const downloadLink = document.createElement("a");
    const fileName = "arquivo";
    
    downloadLink.href = linkSource;
    downloadLink.download = fileName;
    downloadLink.click();
  }


  async abrirArquivo(bt: number){
    var base64 = this.arrayByte[bt];
    const baseData = base64[bt];
    const base = await fetch(baseData);
    
    var baseBlob = await base.blob();
    var blobURL = URL.createObjectURL(baseBlob);
    window.open(blobURL,  'location = yes');    
  }
  
}